    let monthArray = month.split('-',2);
    monthArray.push('01')
    tempParams.month = monthArray.join('-')
  }

  const params = Object.assign(tempParams, page, sort)
  $data.loading = true
  const { objList, pageDesc } = await $dde.get('deaf6cad81814e8ca33e8cf42ce93ea3', { params })
  console.info(objList)
  $data.page = pageDesc
  $data.list = objList
  $data.loading = false
}

